import React,{Component} from 'react';


class TopNavLeftIcon extends Component {
     
    render() {
        return (
            <div className="col-lg-6 col-md-6 col-sm-12 col-xs-12">
                        <ul className="list-inline hover-red list-group">
                            <li><a href="{{https://www.facebook.com/}}" title="Facebook" target="_blank"><i
                                        className="fab fa-facebook-f"></i></a></li>
                            <li><a href="https://plus.google.com/" title="Google+" target="_blank"><i
                                        class="fab fa-google-plus-g"></i></a></li>
                            <li><a href="https://twitter.com" title="Twitter" target="_blank"><i
                                        class="fab fa-twitter"></i></a></li>
                            <li><a href="https://www.linkedin.com" title="LinkedIn" target="_blank"><i
                                        class="fab fa-linkedin-in"></i></a></li>
                            <li><a href="https://www.instagram.com" title="Instagram" target="_blank"><i
                                        class="fab fa-instagram"></i></a></li>
                        </ul>
                    </div>
        )
    };
}
export default TopNavLeftIcon;
